import React from 'react';
import ReactDOM from 'react-dom';

const good = null
const currDate = new Date();
if(currDate.getHours>=1 && currDate.getHours<=11){
    good = 'Good morning'
}
else {
    good = 'Good evening'
}


ReactDOM.render( 
    <>
    <h1>Hello sir, {good}</h1>
    </> ,  document.getElementById("root") );
